/**
 * 栈模拟
 */
class Solution {
public:
    /*
     * 从左往右遍历，所以如果遇到往右走的行星，就可以直接加入到栈中（栈中不存在会和该行星碰撞的行星）

        如果遇到往左走的行星，那就不断地根据栈顶情况分类讨论：
            stack为空或者stack最后一位是往左的，可以直接结束循环，将行星加入栈中
            stack最后一位和该行星一样大，则推出栈的最后一个行星，直接结束循环
            stack最后一位比该行星大，则不做任何操作，直接结束循环
            stack最后一位比该行星小，则推出栈的最后一个行星，继续循环
     */
    vector<int> asteroidCollision(vector<int>& asteroids) {
        stack<int> stack; // 栈中存放向右走的行星

        for(int aster :asteroids){
            bool alive  = true;
            while (alive&&aster<0&&!stack.empty()&&stack.top()>0){ // 遇到向左走的行星
                alive = stack.top() + aster <0; //
                if(stack.top()<= - aster){
                    stack.pop();
                }
            }
            if(alive)
                stack.push(aster);
        }
        int n = stack.size();
        vector<int> stackContent = vector<int>(stack.size(),0);
        while (!stack.empty()){
            stackContent[n-1]=stack.top();
            stack.pop();
            n--;
        }


        return stackContent;
    }
};
